import { useState } from 'react'

const Zoom = () => {
    const [joinMeeting, setJoinMeeting] = useState(false);

  return (
    <div>
   
 
      <button style={{
            border: '2px solid blue',
            padding: '10px 20px',
            borderRadius: '15px',
            backgroundColor: 'blue',
            color: 'gree',
            fontSize: '20px',
            fontWeight: 'bold',
          }} onClick={()=>{joinMeeting()}}>
        Zoom
      </button>
    </div>
  )
}

export default Zoom
